import React from "react";


const App = () => {
  return (
    <div className="app">
      {/* Header */}
      <header className="header">
        <div className="menu-icon">‚ò∞</div>
        <div className="delivery-info">
          <span>Deliver to</span>
          <strong>4102 Pretty View Lane</strong>
        </div>
        <div className="user-avatar">
          <img src="https://via.placeholder.com/40" alt="User Avatar" />
        </div>
      </header>

      {/* Hero Section */}
      <main>
        <section className="hero">
          <h1>What would you like to order</h1>
          <div className="search-bar">
            <input
              type="text"
              placeholder="Find for food or restaurant..."
            />
            <button className="filter-button">‚öôÔ∏è</button>
          </div>
        </section>

        {/* Categories */}
        <section className="categories">
          {["Burger", "Donut", "Pizza", "Mexican", "Asian"].map(
            (category, index) => (
              <div
                key={index}
                className={`category-item ${
                  index === 0 ? "active" : ""
                }`}
              >
                {category}
              </div>
            )
          )}
        </section>

        {/* Featured Restaurants */}
        <section className="featured-restaurants">
          <div className="section-header">
            <h2>Featured Restaurants</h2>
            <a href="/" className="view-all">View All</a>
          </div>
          <div className="restaurants">
            {[
              {
                name: "McDonald's",
                delivery: "Free delivery ‚Ä¢ 10-15 mins",
                tags: "BURGER ‚Ä¢ CHICKEN ‚Ä¢ FAST FOOD",
                image:
                  "https://via.placeholder.com/150",
              },
              {
                name: "Starbucks",
                delivery: "Free delivery ‚Ä¢ 5-10 mins",
                tags: "COFFEE ‚Ä¢ BAKERY",
                image:
                  "https://via.placeholder.com/150",
              },
            ].map((restaurant, index) => (
              <div key={index} className="restaurant-card">
                <img src={restaurant.image} alt={restaurant.name} />
                <div className="restaurant-info">
                  <h3>{restaurant.name}</h3>
                  <p>{restaurant.delivery}</p>
                  <span className="tags">{restaurant.tags}</span>
                </div>
              </div>
            ))}
          </div>
        </section>
      </main>

      {/* Footer */}
      <footer className="footer">
        {["üè†", "üìç", "üõí", "üíñ", "üîî"].map((icon, index) => (
          <div key={index} className="footer-icon">{icon}</div>
        ))}
      </footer>
    </div>
  );
};

export default App;
